import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { NavLink } from "react-router-dom";

const Menu = () => {
    return (
        <>
            <div className = "container-fluid menu">
                <NavLink exact activeClassName = "class_style" to = "/">About</NavLink>
                <NavLink exact activeClassName = "class_style" to = "/service">Service</NavLink>
                <NavLink exact activeClassName = "class_style" to = "/contact">Contact</NavLink>
            </div>
        </>
    )
}
export default Menu;
